function Section_One({ children, active, setActive }) {

    return (
        <>
            <div className='w-[100%] bg-gradient-to-r from-[#0085FF] to-[#1CA2ED]  flex justify-center h-[1]'>
                <ul className='flex h-[5rem] flex-nowrap justify-evenly xl:w-[70%] text-white font-semibold lg:w-[100%] md:pr-8 text-center items-center '>
                    {children.map((tab, index) =>
                        <li onClick={() => setActive(index)} key={index} className={active === index ? '   self-center  select-none' : 'select-none cursor-pointer  self-center '}>
                            {tab.props.title}
                            {active === index ? <motion.div  className='bg-white h-[2px] m-2' ></motion.div> : <div></div>}
                        </li>
                    )}
                </ul>
            </div>
            <div>{children[active]}</div>
        </>
    )
}


export default Section_One
